syntax = "proto3";

package ultimate_api.v1;

message ArrayBool {
  repeated bool value = 1;
}

message ArrayInt64 {
  repeated int64 value = 1;
}

message ArrayInt32 {
  repeated int32 value = 1;
}

message ArrayDouble {
  repeated double value = 1;
}

message ArrayString {
  repeated string value = 1;
}
